        //if (this.state.empleados.length > 0) {
        return (
            <DataGrid titulo='Tipos de Compra' 
                      funcionClick={this.props.funcionClick} 
                      form="FormPurchaseTypes"
                      colsHeaders={[ 'Nombre','Precio' ]}
                      api_url/>             
        )
    } 
}

